script: |
  super -f text -I q10607.spq | sort > q10607.out

inputs:
  - name: q10607.spq
    data: |
      SELECT ( + - 1 ) + - 81 AS col2 FROM tab1 (FORMAT parquet) WHERE NOT - 53 / ( 59 ) + + 95 * col0 BETWEEN CAST ( col1 AS INTEGER ) + + - col0 AND col0;
  - name: tab1

outputs:
  - name: q10607.out
    data: |
      -82
      -82
      -82
